  <nav>
    <ul className='navbar'>
      <li>HOME</li>
      <li>CONTACT</li>
      <li>ABOUT US</li>
    </ul>
  </nav>
)
const write = () => <h1>i am bigyan ghimire</h1>

const text = <h1>hello world</h1>
const root = ReactDOM.createRoot(document.getElementById('root'));
